dom.ready(()=>{$(".ac-tercero").attr("type","search").keydown(fnAcChange).autocomplete({delay:500,minLength:5,focus:fnFalse,search:fnAcSearch,source:function(e,n){fnAutocomplete(this.element,["nombre","nif"],n,e=>e.nif+" - "+e.nombre)},select:function(e,n){return fnAcLoad(this,n.item.nif,n.item.nif+" - "+n.item.nombre)}}).change(fnAcReset).on("search",fnAcReset),$(".ac-pago").attr("type","search").keydown(fnAcChange).autocomplete({delay:500,minLength:3,focus:fnFalse,search:fnAcSearch,source:function(e,n){fnAutocomplete(this.element,["numJg","numDc"],n,e=>e.numJg+": "+e.desc)},select:function(e,n){return fnAcLoad(this,n.item.numJg,n.item.numJg+": "+n.item.desc)}}).change(fnAcReset).on("search",fnAcReset),$(".ac-tramitador").attr("type","search").keydown(fnAcChange).autocomplete({delay:500,minLength:3,focus:fnFalse,search:fnAcSearch,source:function(e,n){fnAutocomplete(this.element,["nombre","utCod","utDesc"],n,e=>e.nombre+"<br>"+e.utCod+" - "+e.utDesc)},select:function(e,n){var t=n.item.utCod+" - "+n.item.utDesc;return fnAcLoad(this,n.item.id,t)}}).change(fnAcReset).on("search",fnAcReset),$(".ac-organica").attr("type","search").keydown(fnAcChange).autocomplete({delay:500,focus:fnFalse,search:fnAcSearch,source:function(e,n){fnAutocomplete(this.element,["o","dOrg"],n,e=>e.o+" - "+e.dOrg)},select:function(e,n){return fnAcLoad(this,n.item.id,n.item.o+" - "+n.item.dOrg)}}).change(fnAcReset).on("search",fnAcReset)});